import React from 'react';

const AdminDashboard = () => {
  return (
    <>
      
      <header className="bg-slate-700 p-5 text-center text-white">
        AdminDashboard
      </header>
      <main className='h-auto bg-gray'></main>
    </>
  );
};

export default AdminDashboard;
